import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import DoorBell from "./components/DoorBell";
import Cart from "./components/Cart";
import Checkout from "./components/Checkout";
import Login from "./components/Login";
import Registration from "./components/Registration";
import { UserProvider } from "./components/UserContext";
import { CartProvider } from "./components/CartContext";
import Payment from "./components/Payment";
import ViewOrder from "./components/ViewOrder";
import { DataProvider } from "./components/Data";

const App = () => {
  return (
    <DataProvider>
      <UserProvider>
        <CartProvider>
          <Router>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/home" element={<Home />} />
              <Route path="/DoorBellList" element={<DoorBell />} />
              {/* <Route path="/DoorLockList" element={<DoorBell />} />
          <Route path="/LightingList" element={<DoorBell />} />
          <Route path="/SpeakerList" element={<DoorBell />} />
          <Route path="/ThermostatList" element={<DoorBell />} /> */}
              <Route path="/Cart" element={<Cart />} />
              <Route path="/Checkout" element={<Checkout />} />
              <Route path="/Login" element={<Login />} />
              <Route path="/Registration" element={<Registration />} />
              <Route path="/Payment" element={<Payment />} />
              <Route path="/ProductModify?button=Addproduct" element={<ViewOrder />} />
              <Route path="/ProductModify?button=Updateproduct" element={<ViewOrder />} />
              <Route path="/ProductModify?button=product" element={<ViewOrder />} />

            </Routes>
          </Router>
        </CartProvider>
      </UserProvider>
    </DataProvider>
  );
};

export default App;
